INSERT INTO public.privacy_policy ("content",publish_date) VALUES
	 ('1. OBJETIVO
O propósito desta Política é descrever e explicar os princípios e regras gerais de Tratamento de Dados Pessoais que devem nortear as operações da Companhia.

Esta Política deve ser lida juntamente com o Código de Ética e políticas e procedimentos relacionados, sobretudo aqueles relacionados às regras de segurança da informação. Em caso de conflito entre esta Política e outras políticas da Atech, deverá prevalecer a política ou o procedimento mais rigoroso em relação à proteção de Dados Pessoais. Em tais circunstâncias, o Empregado ou os Terceiros deve notificar DPW para que este possa imediatamente tratar do conflito, dar-lhe a recomendação acerca das providências adequadas a serem tomadas e, caso necessário, atualizar a respectiva Política ou procedimento.

2. DEFINIÇÕES
Atech ou Companhia: significa Atech Negócios em Tecnologias S.A. e suas filiais.

Controlador: pessoa natural ou jurídica, de direito público ou privado, a quem competem as decisões referentes ao tratamento de dados pessoais;

Data Protection Work Group (DPW): grupo de trabalho responsável por prover orientações e fiscalizações sobre a aplicação desta Política e procedimentos derivados, o qual conterá, obrigatoriamente:
(i)	Um representante do Departamento Jurídico e de Compliance:
(ii)	Um representante de Segurança da Informação;
(iii)	Um representante de Recursos Humanos;
(iv)	Um representante de Suprimentos;
(v)	Um representante do ACE;
(vi)	Um representante de gestão da configuração;
(vii)	Representantes de áreas específicas dependendo do tema a ser tratado nas reuniões de DPW.

Dado Pessoal: qualquer tipo de dado ou informação que possa viabilizar, direta ou indiretamente, a identificação de uma pessoa física, ainda que essa identificação dependa da associação de tal dado/informação com outros elementos.

Dado Pessoal Sensível: dados pessoais que revelem  dado pessoal sobre origem racial ou étnica, as opiniões políticas, as convicções religiosas ou filosóficas, ou a filiação sindical, bem como o tratamento de dados genéticos, dados biométricos para identificar uma pessoa de forma inequívoca, dados relativos a convicção religiosa, opinião política, filiação a sindicato ou a organização de caráter religioso, filosófico ou político, dado referente à saúde ou dados relativos à vida sexual, dado genético ou biométrico, quando vinculado a uma pessoa natural.

Data Protection Officer ou Encarregado (DPO): Representante do Departamento Jurídico e de Compliance responsável por coordenar as atividades do DPW e principal ponto de contato com autoridades, Operadores, Controladores e Titulares de dados em assuntos envolvendo tratamento de dados pessoais.

Empregado: qualquer pessoa que trabalhe para a Atech, incluindo seus diretores, administradores, gerentes e empregados, independentemente do regime de contratação (contrato de trabalho, contrato de prestação de serviço, contrato de estágio etc.).

Filial: significa um estabelecimento, no Brasil ou exterior, sem personalidade jurídica própria e com número de CNPJ de mesma raiz da Embraer.

GDPR: Regulamento Geral de Proteção de Dados - Regulamento da União Europeia n. 679/2016 que trata sobre Proteção de Dados Pessoais.

Incidente: violação ou possível violação de segurança que provoque, de modo acidental ou intencional, a destruição, a perda, a alteração, a divulgação ou o acesso, não autorizados, a dados pessoais.

LGPD: Lei Geral de Proteção de Dados - Lei 13.709 de 2019 – Lei Brasileira que dispõe sobre o tratamento de dados pessoais no Brasil.

Terceiro ou Operador de Dados: qualquer pessoa física (que não seja Empregado da Atech) ou pessoa jurídica contratada e parceiros de negócio (de maneira formal ou informal) que possa realizar qualquer tipo de Tratamento de Dados Pessoal.

Titular: pessoa física a que se refere o Dado Pessoal, podendo ser, inclusive, mas não se limitando, um Empregado da Atech.

Tratamento: qualquer tipo de atividade realizada com Dados Pessoais, inclusive acesso, armazenamento, higienização, visualização, coleta, exclusão, compartilhamento, entre outras.

3. DOCUMENTOS APLICÁVEIS
NA.

4. DESCRIÇÃO E RESPONSABILIDADES
4.1 	A Política

Esta Política deve ser observada pela Atech em todas as operações ao redor do mundo, a conduzir negócios de maneira ética, garantindo o direito à proteção aos Dados Pessoais que são tratados pela Companhia. A presente Política também deve ser observada pelos Terceiros.

Dessa forma, como empresa comprometida com a proteção de Dados Pessoais, a Atech espera que todos os Empregados e Terceiros cumpram esta Política, todos os procedimentos relacionados, o Código de Ética e todas as leis e regulamentações sobre proteção de Dados Pessoais aplicáveis.

Esta Política, e os exemplos nesta fornecidos, não tem como objetivo fornecer respostas a todas as questões e considerações relativas à proteção de Dados Pessoais, mas têm o objetivo de auxiliar o leitor a entender o objeto e a importância da proteção de dados. Portanto, sempre que houver alguma dúvida sobre a aplicação da Política, ou quaisquer dúvidas ou desconfianças em relação à adequação de qualquer conduta, o DPW deverá ser acionado imediatamente, por meio do endereço de e-mail indicado no final desta Política.

Espera-se que todos os Empregados e todos os parceiros de negócios da Atech conheçam esta Política e a observem, reconheçam e reportem possíveis questões relacionadas a situações de proteção de Dados Pessoais com tempo suficiente para que sejam tratadas de maneira adequada pelo DPW.


4.2 	Diretrizes

4.2.1 Princípios

Todas as atividades de Tratamento realizadas por aqueles em que esta Política se aplica deverão respeitar os seguintes princípios:

a)	[LICITUDE, LEALDADE E TRANSPARÊNCIA]: Respeitar a lealdade, licitude e transparência no Tratamento de Dados Pessoais, o que significa que os Dados Pessoais somente deverão ser tratados nas hipóteses permitidas pela legislação aplicável, sempre com a máxima transparência ao Titular e de acordo com os mandamentos éticos que conduzem as atividades da Atech;

b)	[MINIMIZAÇÃO]: Tratar o menor volume de Dados Pessoais possíveis para se atingir as finalidades que justificam sua coleta, mantendo-os pelo menor tempo necessário;

c)	[EXATIDÃO]: Adotar medidas razoáveis (técnicas e organizacionais) para manter os Dados Pessoais sempre corretos e atualizados, inclusive com a possibilidade de solicitação de correção pelo próprio Titular;

d)	[PSEUDOANONIMIZAÇÃO]: Realizar, sempre que possível, técnicas de pseudoanonimização que tornem impossível identificar o Titular sem que haja associação com outros dados ou informações complementares (os quais devem estar armazenados de forma a garantir que não ocorrerá a identificação). Em outras palavras, deve-se sempre buscar que os dados tratados sejam desassociados de informações que permitam a identificação direta do Titular;

e)	[SEGURANÇA DA INFORMAÇÃO]: Adotar todas as medidas de segurança
adequadas para garantir a confidencialidade, a disponibilidade e a integralidade dos Dados Pessoais, observando-se as especificações técnicas estabelecidas pela Atech;
f)	[ACCOUNTABILITY/RESPONSABILIDADE PRÓ-ATIVA]: Implementar medidas que permitam demonstrar o cumprimento desta Política e das demais normas aplicáveis à proteção de Dados Pessoais, por exemplo, documentando por escrito todas as medidas adotadas com o objetivo de assegurar a proteção de dados (desde estudos técnicos de medidas de segurança até avaliações de impacto, quando estas forem necessárias de acordo com a legislação aplicável).

g)	[PRIVACY BY DESIGN]: Todo e qualquer produto, serviço ou atividade exercida pela Atech deverá ter como princípio a privacidade e proteção de dados pessoais desde sua concepção, portanto, o DPW sempre deverá ser envolvido em toda e qualquer concepção de nova atividade/sistema/aplicação/produto que exija tratamento de dados pessoais, bem como na atualização das mesmas.

4.3 	Procedimentos

Serão estabelecidos procedimentos específicos nos casos em que seja necessário o tratamento de dados pessoais feitos pela Atech ou por Terceiros, para tanto, as diretrizes abaixo serão seguidas quando da publicação de tais procedimentos:


4.3.1 Viabilizar o Exercício de Direitos – A Atech deverá garantir que todos os Titulares poderão exercer seus direitos:

a)	Correção de dados pessoais que estiverem sendo tratados pela Atech ou Terceiros para os quais a Atech tenha transferido os dados;
b)	Exclusão (quando não haja dever legal que faça com que a Atech mantenha armazenado o respectivo Dado Pessoal);

c)	Limitação do Tratamento e revogação do consentimento, ou seja, o Titular pode solicitar que seus dados sejam tratados de acordo com certos limites (respeitada a legislação aplicável e as diretrizes do do DPW), bem como voltar atrás em relação a seu consentimento para Tratamento de dados, principalmente quando tal Tratamento seja realizado para finalidades comerciais/de marketing.

4.3.2 Cumprir com as Regras de Segurança da Informação

Todo o Tratamento deve ser realizado de acordo com os padrões técnicos e operacionais de Segurança da Informação indicados pela Atech, de modo a se garantir a confidencialidade, disponibilidade e a integridade dos Dados Pessoais.

4.3.3 Manter Canal de Comunicação Ativo e Acessível ao Titular

Os Titulares poderão apresentar qualquer dúvida ou reclamação de seus direitos de proteção de dados junto à Atech no e-mail dpo@atech.com.br. Os Titulares também poderão reportar violações ou suspeitas de violações ligadas ao tema por meio do Helpline – Canal de Denúncias, utilizando o site www.atechhelpline.com. A Atech deverá apresentar resposta em prazo razoável, respeitando-se as exigências da legislação local.

4.4 	Disposições Gerais

4.4.1 Sanções

A Atech e/ou seus Empregados podem ser investigados por órgãos reguladores estatais em jurisdições diferentes e, dependendo das circunstâncias, processados administrativamente, civilmente ou criminalmente. Isso pode resultar em multas elevadas e penalidades graves, exclusões e/ou demais punições caso a Companhia e/ou seus Empregados violem as leis e/ou regulamentações de proteção de Dados Pessoais.

Qualquer Empregado flagrado em violação desta Política estará́ sujeito a medidas disciplinares.

Terceiros que forem flagrados em violação desta Política estarão sujeitos à extinção de sua relação comercial sem prejuízo a quaisquer outras medidas reparadoras e jurídicas à disposição da Atech nos termos da lei aplicável e respectivos contratos.

4.4.2 Não Retaliação

A Atech em nenhuma hipótese admitirá a retaliação, represália ou assédio, velado ou de qualquer outra forma, por qualquer Empregado contra qualquer indivíduo, sendo este Empregado ou Terceiro, por qualquer comunicação de boa-fé relacionados a: (i) questões relativas violações reais ou potenciais desta Política; (ii) violação real ou potencial de qualquer lei ou regulamento federal, estadual ou municipal em que esta Política se enquadre. De acordo com essa política, com Código de Ética e Conduta bem como com qualquer política interna relevante, a Atech tomará as medidas cabíveis, contra qualquer Empregado que violar esta declaração de não retaliação.

4.4.3 Treinamento

O treinamento sobre proteção de dados pessoais da Atech ocorrerá de acordo com a programação definida anualmente pelo DPW.

4.4.4 Data Protection Work Group (DPW)

O DPW, conforme definido nessa política, se encontrará pelo menos uma vez por mês, podendo haver reuniões extraordinárias sempre que necessário e possuirá atribuições específicas definidas em procedimento próprio.



4.4.5 Incidentes

Será estabelecido procedimento próprio para tratar de incidentes que envolvam dados pessoais.

4.4.6 DPO

As atividades do DPO serão definidas no procedimento que estabelece o DPW.

4.4.7 Dúvidas e Relatos

Quaisquer dúvidas e/ou relatos de descumprimento a esta Política deverão ser imediatamente encaminhados ao e-mail: dpo@atech.com.br.

Os Titulares também poderão reportar violações ligadas ao tema por meio do Helpline – Canal de Denúncias, utilizando o site www.atechhelpline.com.

4.5 	Responsável – Departamento Jurídico

O Departamento Jurídico e Compliance da ATECH é o proprietário desta Política e também responsável por mantê-la e gerenciá-la de forma consistente, sendo também a área responsável pela liderança das atividades previstas e relacionadas a esta Política em conjunto com o desenvolvimento das atividades do DPW.

Esta Política está sujeita a alterações, conforme possa considerar necessária e apropriada, segundo recomendação do DPW, com base em mudanças nas políticas aplicáveis á Atech ou nas leis e regulamentações relevantes.

5. REGISTROS DA QUALIDADE
NA.
6. DISTRIBUIÇÃO
Este documento está disponível na intratech. É de responsabilidade do colaborador ao utilizar cópia impressa deste documento, verificar se é a revisão vigente na intratech.
','2020-02-17 00:00:00'),
	 ('1. OBJETIVO
O propósito desta Política é descrever e explicar os princípios e regras gerais de Tratamento de Dados Pessoais que devem nortear as operações da Companhia.

Esta Política deve ser lida juntamente com o Código de Ética e políticas e procedimentos relacionados, sobretudo aqueles relacionados às regras de segurança da informação. Em caso de conflito entre esta Política e outras políticas da Atech, deverá prevalecer a política ou o procedimento mais rigoroso em relação à proteção de Dados Pessoais. Em tais circunstâncias, o Empregado ou os Terceiros deve notificar DPW para que este possa imediatamente tratar do conflito, dar-lhe a recomendação acerca das providências adequadas a serem tomadas e, caso necessário, atualizar a respectiva Política ou procedimento.

2. DEFINIÇÕES
Atech ou Companhia: significa Atech Negócios em Tecnologias S.A. e suas filiais.

Controlador: pessoa natural ou jurídica, de direito público ou privado, a quem competem as decisões referentes ao tratamento de dados pessoais;

Data Protection Work Group (DPW): grupo de trabalho responsável por prover orientações e fiscalizações sobre a aplicação desta Política e procedimentos derivados, o qual conterá, obrigatoriamente:
(i)	Um representante do Departamento Jurídico e de Compliance:
(ii)	Um representante de Segurança da Informação;
(iii)	Um representante de Recursos Humanos;
(iv)	Um representante de Suprimentos;
(v)	Um representante do ACE;
(vi)	Um representante de gestão da configuração;
(vii)	Representantes de áreas específicas dependendo do tema a ser tratado nas reuniões de DPW.

Dado Pessoal: qualquer tipo de dado ou informação que possa viabilizar, direta ou indiretamente, a identificação de uma pessoa física, ainda que essa identificação dependa da associação de tal dado/informação com outros elementos.

Dado Pessoal Sensível: dados pessoais que revelem  dado pessoal sobre origem racial ou étnica, as opiniões políticas, as convicções religiosas ou filosóficas, ou a filiação sindical, bem como o tratamento de dados genéticos, dados biométricos para identificar uma pessoa de forma inequívoca, dados relativos a convicção religiosa, opinião política, filiação a sindicato ou a organização de caráter religioso, filosófico ou político, dado referente à saúde ou dados relativos à vida sexual, dado genético ou biométrico, quando vinculado a uma pessoa natural.

Data Protection Officer ou Encarregado (DPO): Representante do Departamento Jurídico e de Compliance responsável por coordenar as atividades do DPW e principal ponto de contato com autoridades, Operadores, Controladores e Titulares de dados em assuntos envolvendo tratamento de dados pessoais.

Empregado: qualquer pessoa que trabalhe para a Atech, incluindo seus diretores, administradores, gerentes e empregados, independentemente do regime de contratação (contrato de trabalho, contrato de prestação de serviço, contrato de estágio etc.).

Filial: significa um estabelecimento, no Brasil ou exterior, sem personalidade jurídica própria e com número de CNPJ de mesma raiz da Embraer.

GDPR: Regulamento Geral de Proteção de Dados - Regulamento da União Europeia n. 679/2016 que trata sobre Proteção de Dados Pessoais.

Incidente: violação ou possível violação de segurança que provoque, de modo acidental ou intencional, a destruição, a perda, a alteração, a divulgação ou o acesso, não autorizados, a dados pessoais.

LGPD: Lei Geral de Proteção de Dados - Lei 13.709 de 2019 – Lei Brasileira que dispõe sobre o tratamento de dados pessoais no Brasil.

Terceiro ou Operador de Dados: qualquer pessoa física (que não seja Empregado da Atech) ou pessoa jurídica contratada e parceiros de negócio (de maneira formal ou informal) que possa realizar qualquer tipo de Tratamento de Dados Pessoal.

Titular: pessoa física a que se refere o Dado Pessoal, podendo ser, inclusive, mas não se limitando, um Empregado da Atech.

Tratamento: qualquer tipo de atividade realizada com Dados Pessoais, inclusive acesso, armazenamento, higienização, visualização, coleta, exclusão, compartilhamento, entre outras.

3. DOCUMENTOS APLICÁVEIS
NA.

4. DESCRIÇÃO E RESPONSABILIDADES
4.1 	A Política

Esta Política deve ser observada pela Atech em todas as operações ao redor do mundo, a conduzir negócios de maneira ética, garantindo o direito à proteção aos Dados Pessoais que são tratados pela Companhia. A presente Política também deve ser observada pelos Terceiros.

Dessa forma, como empresa comprometida com a proteção de Dados Pessoais, a Atech espera que todos os Empregados e Terceiros cumpram esta Política, todos os procedimentos relacionados, o Código de Ética e todas as leis e regulamentações sobre proteção de Dados Pessoais aplicáveis.

Esta Política, e os exemplos nesta fornecidos, não tem como objetivo fornecer respostas a todas as questões e considerações relativas à proteção de Dados Pessoais, mas têm o objetivo de auxiliar o leitor a entender o objeto e a importância da proteção de dados. Portanto, sempre que houver alguma dúvida sobre a aplicação da Política, ou quaisquer dúvidas ou desconfianças em relação à adequação de qualquer conduta, o DPW deverá ser acionado imediatamente, por meio do endereço de e-mail indicado no final desta Política.

Espera-se que todos os Empregados e todos os parceiros de negócios da Atech conheçam esta Política e a observem, reconheçam e reportem possíveis questões relacionadas a situações de proteção de Dados Pessoais com tempo suficiente para que sejam tratadas de maneira adequada pelo DPW.


4.2 	Diretrizes

4.2.1 Princípios

Todas as atividades de Tratamento realizadas por aqueles em que esta Política se aplica deverão respeitar os seguintes princípios:

a)	[LICITUDE, LEALDADE E TRANSPARÊNCIA]: Respeitar a lealdade, licitude e transparência no Tratamento de Dados Pessoais, o que significa que os Dados Pessoais somente deverão ser tratados nas hipóteses permitidas pela legislação aplicável, sempre com a máxima transparência ao Titular e de acordo com os mandamentos éticos que conduzem as atividades da Atech;

b)	[MINIMIZAÇÃO]: Tratar o menor volume de Dados Pessoais possíveis para se atingir as finalidades que justificam sua coleta, mantendo-os pelo menor tempo necessário;

c)	[EXATIDÃO]: Adotar medidas razoáveis (técnicas e organizacionais) para manter os Dados Pessoais sempre corretos e atualizados, inclusive com a possibilidade de solicitação de correção pelo próprio Titular;

d)	[PSEUDOANONIMIZAÇÃO]: Realizar, sempre que possível, técnicas de pseudoanonimização que tornem impossível identificar o Titular sem que haja associação com outros dados ou informações complementares (os quais devem estar armazenados de forma a garantir que não ocorrerá a identificação). Em outras palavras, deve-se sempre buscar que os dados tratados sejam desassociados de informações que permitam a identificação direta do Titular;

e)	[SEGURANÇA DA INFORMAÇÃO]: Adotar todas as medidas de segurança
adequadas para garantir a confidencialidade, a disponibilidade e a integralidade dos Dados Pessoais, observando-se as especificações técnicas estabelecidas pela Atech;
f)	[ACCOUNTABILITY/RESPONSABILIDADE PRÓ-ATIVA]: Implementar medidas que permitam demonstrar o cumprimento desta Política e das demais normas aplicáveis à proteção de Dados Pessoais, por exemplo, documentando por escrito todas as medidas adotadas com o objetivo de assegurar a proteção de dados (desde estudos técnicos de medidas de segurança até avaliações de impacto, quando estas forem necessárias de acordo com a legislação aplicável).

g)	[PRIVACY BY DESIGN]: Todo e qualquer produto, serviço ou atividade exercida pela Atech deverá ter como princípio a privacidade e proteção de dados pessoais desde sua concepção, portanto, o DPW sempre deverá ser envolvido em toda e qualquer concepção de nova atividade/sistema/aplicação/produto que exija tratamento de dados pessoais, bem como na atualização das mesmas.

4.3 	Procedimentos

Serão estabelecidos procedimentos específicos nos casos em que seja necessário o tratamento de dados pessoais feitos pela Atech ou por Terceiros, para tanto, as diretrizes abaixo serão seguidas quando da publicação de tais procedimentos:


4.3.1 Viabilizar o Exercício de Direitos – A Atech deverá garantir que todos os Titulares poderão exercer seus direitos:

a)	Correção de dados pessoais que estiverem sendo tratados pela Atech ou Terceiros para os quais a Atech tenha transferido os dados;
b)	Exclusão (quando não haja dever legal que faça com que a Atech mantenha armazenado o respectivo Dado Pessoal);

c)	Limitação do Tratamento e revogação do consentimento, ou seja, o Titular pode solicitar que seus dados sejam tratados de acordo com certos limites (respeitada a legislação aplicável e as diretrizes do do DPW), bem como voltar atrás em relação a seu consentimento para Tratamento de dados, principalmente quando tal Tratamento seja realizado para finalidades comerciais/de marketing.

4.3.2 Cumprir com as Regras de Segurança da Informação

Todo o Tratamento deve ser realizado de acordo com os padrões técnicos e operacionais de Segurança da Informação indicados pela Atech, de modo a se garantir a confidencialidade, disponibilidade e a integridade dos Dados Pessoais.

4.3.3 Manter Canal de Comunicação Ativo e Acessível ao Titular

Os Titulares poderão apresentar qualquer dúvida ou reclamação de seus direitos de proteção de dados junto à Atech no e-mail dpo@atech.com.br. Os Titulares também poderão reportar violações ou suspeitas de violações ligadas ao tema por meio do Helpline – Canal de Denúncias, utilizando o site www.atechhelpline.com. A Atech deverá apresentar resposta em prazo razoável, respeitando-se as exigências da legislação local.

4.4 	Disposições Gerais

4.4.1 Sanções

A Atech e/ou seus Empregados podem ser investigados por órgãos reguladores estatais em jurisdições diferentes e, dependendo das circunstâncias, processados administrativamente, civilmente ou criminalmente. Isso pode resultar em multas elevadas e penalidades graves, exclusões e/ou demais punições caso a Companhia e/ou seus Empregados violem as leis e/ou regulamentações de proteção de Dados Pessoais.

Qualquer Empregado flagrado em violação desta Política estará́ sujeito a medidas disciplinares.

Terceiros que forem flagrados em violação desta Política estarão sujeitos à extinção de sua relação comercial sem prejuízo a quaisquer outras medidas reparadoras e jurídicas à disposição da Atech nos termos da lei aplicável e respectivos contratos.

4.4.2 Não Retaliação

A Atech em nenhuma hipótese admitirá a retaliação, represália ou assédio, velado ou de qualquer outra forma, por qualquer Empregado contra qualquer indivíduo, sendo este Empregado ou Terceiro, por qualquer comunicação de boa-fé relacionados a: (i) questões relativas violações reais ou potenciais desta Política; (ii) violação real ou potencial de qualquer lei ou regulamento federal, estadual ou municipal em que esta Política se enquadre. De acordo com essa política, com Código de Ética e Conduta bem como com qualquer política interna relevante, a Atech tomará as medidas cabíveis, contra qualquer Empregado que violar esta declaração de não retaliação.

4.4.3 Treinamento

O treinamento sobre proteção de dados pessoais da Atech ocorrerá de acordo com a programação definida anualmente pelo DPW.

4.4.4 Data Protection Work Group (DPW)

O DPW, conforme definido nessa política, se encontrará pelo menos uma vez por mês, podendo haver reuniões extraordinárias sempre que necessário e possuirá atribuições específicas definidas em procedimento próprio.



4.4.5 Incidentes

Será estabelecido procedimento próprio para tratar de incidentes que envolvam dados pessoais.

4.4.6 DPO

As atividades do DPO serão definidas no procedimento que estabelece o DPW.

4.4.7 Dúvidas e Relatos

Quaisquer dúvidas e/ou relatos de descumprimento a esta Política deverão ser imediatamente encaminhados ao e-mail: dpo@atech.com.br.

Os Titulares também poderão reportar violações ligadas ao tema por meio do Helpline – Canal de Denúncias, utilizando o site www.atechhelpline.com.

4.5 	Responsável – Departamento Jurídico

O Departamento Jurídico e Compliance da ATECH é o proprietário desta Política e também responsável por mantê-la e gerenciá-la de forma consistente, sendo também a área responsável pela liderança das atividades previstas e relacionadas a esta Política em conjunto com o desenvolvimento das atividades do DPW.

Esta Política está sujeita a alterações, conforme possa considerar necessária e apropriada, segundo recomendação do DPW, com base em mudanças nas políticas aplicáveis á Atech ou nas leis e regulamentações relevantes.

5. REGISTROS DA QUALIDADE
NA.
6. DISTRIBUIÇÃO
Este documento está disponível na intratech. É de responsabilidade do colaborador ao utilizar cópia impressa deste documento, verificar se é a revisão vigente na intratech.
