A utilização do APP e dos recursos e ferramentas disponibilizados é regida por este TERMO e pela POLÍTICA DE PRIVACIDADE e ambos são aplicáveis a qualquer Usuário do APP. Fica esclarecido que os termos “Usuário” ou “Você” significam todos os usuários do APP, sejam eles contratados, contratantes, terceiros, clientes e/ou quaisquer pessoas físicas ou jurídicas que venham a ter qualquer inteiração com o APP.
Adicionalmente, todos os Usuários estarão sujeitos à contratos específicos que serão assinados entre as partes.

1.	TERMOS DE USO DO APP

a)	Neste ato, a Atech concede a Você uma licença limitada, não exclusiva, intransferível, não sublicenciável e revogável para utilizar o APP de acordo com este TERMO e a POLÍTICA DE PRIVACIDADE.

b)	O APP será ofertado na Play Store (Google Play) e Apple Store. Para utilizar, Você deverá ter um dispositivo ou celular com o sistema Android ou IOS, que permita a conexão à internet (como, por exemplo, conexão wifi, 3G ou 4G). O APP não poderá ser utilizado caso não possua este tipo de conexão e tecnologia, e a aquisição de tais conexões e tecnologias é de sua total responsabilidade. Os termos e condições que regem o seu acesso e uso da Apple Store e Play Store estão dispostos nas respectivas políticas de cada loja, e a Atech não tem qualquer responsabilidade sobre isso.

2.	PROPRIEDADE INTELECTUAL

a)	O APP, assim como todos os elementos que o compõe, é detido ou controlado pela Atech e é protegido pela lei contra utilização não autorizada. Você não adquire quaisquer direitos ao utilizar o APP, assim como baixar ou enviar qualquer conteúdo, a não ser conforme descrito expressamente neste TERMO. Você se compromete a não copiar, modificar, redistribuir, decompilar, fazer engenharia reversa, traduzir, publicar ou de qualquer maneira explorar o APP.

3.	CADASTRAMENTO PARA UTILIZAÇÃO DO APP

a)	Para utilizar o APP, será necessário que o Usuário crie um nome de usuário e informe alguns dados pessoais. Por favor, leia a POLÍTICA DE PRIVACIDADE para entender como o APP terá acesso aos seus dados. Ao se cadastrar, o Usuário declara ter lido, compreendido e aceitado os termos deste documento e da POLÍTICA DE PRIVACIDADE.

b)	O APP possui duas diferentes perfis que devem ser identificados para que o Usuário faça o uso correto do APP. Ficam definidos que: “Cliente” são produtores rurais, pessoas físicas ou jurídicas, que têm interesse em solicitar os serviços da Atech por meio do APP; “Empresas de aerolevantamento (imageamento)” são fornecedores contratados pela Atech para tirar fotos da fazenda do Cliente através de drones e satélites; “Assessoria agronômica (agrônomo)” são fornecedores contratados pela Atech para sugerir os defensivos a serem aplicados na região onde foram encontradas infestações e serão os responsáveis técnicos pela aplicação dos defensivos quando a aeroagrícola (empresa de pulverização) for contratada através do APP; “Empresas de pulverização” são fornecedores homologados pela Atech, porém contratados diretamente pelo Cliente, para realizar a aplicação de defensivos na fazenda dos Clientes, mediante acordo celebrado diretamente entre eles.

c)	É de exclusiva responsabilidade do Usuário fornecer, atualizar e garantir a veracidade dos dados cadastrais e é vedada a criação de mais de um cadastro por Usuário.

4.	REGRAS PARA UTILIZAÇÃO DO APP

a)	Todo e qualquer comentário e informação inserida no APP pelo Usuário é de inteira sua inteira responsabilidade, inclusive perante terceiros e demais usuários do APP.

b)	O APP deve ser utilizado exclusivamente nos termos dos contratos celebrados entre Usuários e Atech.

c)	Ao utilizar o APP, o Usuário concorda em abster-se de:
(i)	Burlar, ou tentar burlar, de qualquer forma que seja o APP;
(ii)	Incluir meios de contato como telefone, e-mail, endereço e outras formas de comunicação nos campos de livre preenchimento próprios ou de terceiros;
(iii)	Tentar se fazer passar por outra pessoa;
(iv)	Fraudar, trapacear, enganar, difamar ou de outra forma violar os direitos da Atech e de outros Usuários, especialmente para tentar descobrir informações pessoais de outros usuários, violar a sua intimidade ou privacidade ou obter qualquer tipo de vantagem, para si ou terceiros;
(v)	Postar conteúdo que fraude direitos de terceiros;
(vi)	Iniciar atividades comerciais, tais como, promoção e publicidade de produtos e serviços, esquemas financeiros ou correntes;
(vii)	Depreciar ou prejudicar o APP ou a Atech;
(viii)	Violar este TERMO e qualquer outra regra divulgada pela Atech, e qualquer legislação municipal, estadual, federal ou internacional aplicável;
(ix)	Disseminar ou tentar enviar vírus de computador, incluindo, mas não se limitando a cavalos de tróia, worms, keyboard loggers, bombas relógio, spywares, adwares, cancelbots ou qualquer outro código ou programa invasivo ou malicioso;
(x)	Disseminar ou tentar enviar spams ou qualquer outro material que possa modificar, interromper ou interferir no funcionamento, operação ou manutenção do APP, ou prejudicar o uso e qualidade oferecida aos Usuários;
(xi)	Enviar ou tentar disseminar materiais que passivamente ou ativamente coletam informações, como gifs, web bugs, cookies e spywares, entre outros;
(xii)	Usar, desenvolver ou lançar sistemas automáticos que possam acessar o APP, como spiders, robots, scrapers ou leitores offline, crawlers, ferramentas de captação de dados ou similares;
(xiii)	Utilizar ferramentas ou proxy anônimo com a finalidade de tornar seu endereço de IP (Protocolo de Internet) anônimo;
(xiv)	Interferir ou quebrar qualquer sistema de segurança do APP;
