(xvi)	Encaminhar qualquer conteúdo a terceiros;
(xvii)	Ofender à imagem, à honra, reputação e dignidade de terceiros;
(xviii)	Cometer atos de racismo ou discriminação de qualquer natureza;
(xix)	Cometer atos de bullying ou qualquer espécie de constrangimento ilegal ou assédio;
(xx)	Veicular ou permitir que se veicule pornografia, pedofilia e outras modalidades de distúrbios ligados ao sexo;
(xxi)	Utilizar de marcas, símbolos, logotipos ou emblemas de terceiros;
(xxii)	Instigar ou fazer apologia a prática de crimes, como tráfico ou uso de entorpecentes, estupro, homicídio, estelionato, dentre outros crimes.

5.	CONTEÚDO POSTADO POR USUÁRIOS

a)	A Atech determinará, a seu exclusivo critério, qual conteúdo será disponibilizado no APP e o momento e duração da disponibilização do mesmo, assim como o formato de disponibilização. Porém ,o Usuário responde por todo o conteúdo que postar no APP, inclusive no que diz respeito à titularidade dos direitos relacionados a tais postagens, nos termos da legislação aplicável.

b)	O Usuário reconhece e concorda que o conteúdo postado no APP por outros usuários não relata a opinião da Atech.

c)	Qualquer conteúdo que não guarde relação com a temática do APP ou, a critério da Atech, seja considerado inadequado, poderá ser removido sem prévia notificação a quem o inseriu.

6.	VIOLAÇÕES

a)	Caso a Atech tome conhecimento de qualquer prática ilegal ou abusiva ou que viole este TERMO, praticada por qualquer Usuário, a Atech poderá cancelar, temporária ou definitivamente, o acesso ao APP desse Usuário, a seu critério.

b)	A Atech poderá adotar contra o Usuário as medidas judiciais e extrajudiciais cabíveis para resguardar seus direitos, de seus Cliente e proteger o APP. A Atech denunciará às autoridades competentes quaisquer atos que possam atentar contra as leis e aos usos e costumes brasileiros.

